import React from 'react';
import'./style.css';

/**
* @author
* @function Rightcolumn
**/

const Rightcolumn = (props) => {
  return(
    <div className="rightcolumn">
            
            <h1>Top Post</h1>
            <hr/>
            <section className="topPost">
            </section>
            
    </div>
   )

 }

export default Rightcolumn;
